import React from 'react';

function Header(props) {
    return (
        <header>
            <div class='headerContainer'>
                <h2>toMasterDev</h2>
                <div class='headerButtonsContainer'>
                    <button class='headerButton' id='browseButton' hidden>Browse</button>
                    <button class='headerButton' id='signInButton'>Sign In</button>
                    <button class='headerButton' id='signUpButton'>Sign Up</button>
                </div>
            </div>

        </header>
    );
}

export default Header;
